VALUES ('4014760002231', 'Petits moussaillons', 'FR : Petits moussaillons - Portions moulées de chair hachée de poisson et d\'autres ingrédients, panées, préfrites, surgelées. Farce (66%) : poisson* (80 farine de riz, farine de _blé_, huile de tournesol, eau, sel, levure, paprika. Enrobage (34 %) : farine de _blé_, huile de tournesol, eau, sel, paprika, levure. *Poisson utilisé dans des proportions variables : Colin d\'Alaska (Theragra chalcogramma), pêché en Océan Pacifique Nord-Ouest FAO NO 61 ou en Océan Pacifique Nord-Est FAO NO 67. Pêché au chalut / Hoki de Nouvelle-Zélande (Macruronus novaezelandiae), pêché en Océan Pacifique Sud-Ouest FAO NO 81. Pêché au chalut/ Lieu Noir (Pollachius virens), pêché en Océan Atlantique Nord-Est FAO NO 27 (sous zones : mer de Barents ; mer de Norvège; Spitzberg et îles aux ours ; mer du Nord ; Islande, plateau et banc des Féroé). Pêché au chalut / Merlu Blanc (Merluccius gayi), pêché en Océan Pacifique Sud-Est FAO NO 87/ Merlu du Pacifique (Merluccius productus), pêché en Océan Pacifique Nord-Est FAO NO 67/ Merlu Argentin (Merluccius hubbsi), pêché en Océan Atlantique Sud-Ouest FAO NO 41. Pêché au chalut / Cabillaud (Gadus morhua), pêché en Océan Atlantique Nord-Ouest FAO NO 21. Pêché à la lignes et hameçons, casiers et pièges/ Cabillaud (Gadus morhua), pêché en Océan Atlantique Nord-Est FAO NO 27 (sous zones : mer de Barents ; mer de Norvège ; Spitzberg et îles aux ours ; mer du Nord ; Islande, plateau et banc des Féroé), péché à la ligne et hameçon / Cabillaud (Gadus macrocephalus), péché en Océan Pacifique Nord-Est FAO NO 67, pêché au chalut / Eglefin (Melanogrammus aeglefinus), péché en Océan Atlantique Nord-Est FAO NO 27 (Nord-Est de l\'Arctique et mer de Norvège). Péché au chalut, filets maillants et filets similaires,', 'https://static.openfoodfacts.org/images/products/401/476/000/2231/front_fr.4.400.jpg', '12.7', '1.3', '17.8', '1.5', '2.4', '9.9', '1.13', '0.444881889763779', '', '0');

