VALUES ('4016241040800', 'Skyr Frucht & Kerne', 'DESSERTMIT FRISCHKASE (56% ), SONNENBLUMENKERNEN UND BUCHWEIZEN UNTERLEGT MIT FRUCHTZUBERETUNG Skyr hat seinen Ursprung in Island ein Land gepragt von den Kraften der Natur. Traditionell hilft Skyr den Bewohnern Islands, trotz anspruchsvoller Verhältnisse ihrer Leidenschaft nachzugehen. Nach isländischer Tradition hergestellt, ist Arla@Skyr natürlich reich an Protein und somit dein Stück Island für die Herausforderungen deines Alltags. Was immer dich bewegt, Arla Skyr bringt dich weiter. Mehr Infos auf www.arlafoods.de/skyr Zutater Magermilch, Wasser, Pfirsiche (4,2%), Zucker, Sonnenblumenkerne(2,8%6), inteeren (2,6%), Buchweizenschrot (0,9%), Mohnsamen, Zitronensaftkonzentrat Sare naturiches Aroma, mikrobielles Lab, Milchsäurekulturen (enthäit Milch) Bel8 mindestens haltbar bis: siehe Deckel. *Mindestens 50% weniqer Zucker as eie vergleichbare süße Frischkäsezubereitung. **Hergestellt in Deutschland', 'https://static.openfoodfacts.org/images/products/401/624/104/0800/front_de.3.400.jpg', '2', '0.3', '8.3', '6.1', '', '7.9', '0.01', '0.00393700787401575', '', '1');

